def subscribe(self, title, item, funcName):
        func = getattr(item, funcName, None)
        if not func:
            logger.error(f"qml订阅事件失败！未在 {item} 中找到函数 {funcName} 。")
            return
        PubSubService.subscribe(title, func)
        fKey = title + funcName
        self._funcDict[fKey] = func
